function App() {
  return (
    <>
      <Dropdown name="Gi">
        <Dropdown2
          name="Attack"
          positions={positions}
          moves={moves}
          styles="gi"
        ></Dropdown2>
        <Dropdown2
          name="Sweep"
          positions={positions}
          moves={moves}
          styles="gi"
        ></Dropdown2>
        <Dropdown2
          name="Submission"
          positions={positions}
          moves={moves}
          styles="gi"
