      </Dropdown>
      <Dropdown name="No Gi">
        <Dropdown2
          name="Attack"
          positions={positions}
          moves={moves}
          styles="noGi"
        ></Dropdown2>
        <Dropdown2
          name="Sweep"
          positions={positions}
          moves={moves}
          styles="noGi"
        ></Dropdown2>
        <Dropdown2
          name="Submission"
          positions={positions}
          moves={moves}
          styles="noGi"
        ></Dropdown2>
      </Dropdown>
    </>
  );
}

export default App;

